import React from 'react';

function Newtweet () {
    return (
        <form id="newTweet">
            <input
                type="text"
                name="name"
                placeholder="Title"
                required></input>
            <textarea
                placeholder="Tweet text [maximum 256 characters]"
                maxlength="256"
                required></textarea>
            {/* <button>Post a new tweet</button> */ }
            <input type="submit" value="Submit" />
        </form>
    );
}

export default Newtweet;
